import { InputName } from "../reducers/FormReducers";

export const LoginStartingValues = [
  { name: "username" as InputName },
  { name: "password" as InputName, type: "password" }
];

export const RegistrationStartingValues = [
  { name: "username" as InputName },
  { name: "password" as InputName }
];
